export default function MainWindow() {
    return (<section class="homepage">
        <Title/>
        <br class="free-space" />
        <Crossroad/>
    </section>)
}

function Title() {
    return (
        <div class="title">
            <h1>Welcome to Machine Learning Data Visualisation</h1>
        </div>
    )
}

function Crossroad() {
    return (
        <div class="crossroad">
            <Button text="Visualize"/>
            <Button text="Analize"/>
        </div>
    )
}

function Button( {text} ) {
    return <button class="homepage-button">{text}</button>;
}
